The material was recorded between 1981 and 1984 at various different concerts in Europe and the UK, but, the majority of record one was recorded at The Manhattan, Bradford, England on January 3rd (or 4th, there is a debate over whether this gig actually took place on a Monday or Tuesday), 1983. The majority of record two was recorded live at Doornroosje, Nijmegen, Netherlands (not the new building which houses the venue now, it used to be in an old school building). It was one of the first places in the Netherlands where hash and marijuana were openly available, and apparently Andrew Eldritch was on very good form with his inter-song banter with the audience that night. Coincidence? The encore that night, which is on this album, was lengthy and wild, including a  nine minute version of Sister Ray and a seventeen minute Ghost Rider/Louie Louie medley.
